import React from "react";
import { Fragment } from "react";
const Contact = () => {
	return (
		<Fragment>
			<h1>Contact Me</h1>
			<div className="container-flex">
				<form>
					<div>
						<div>
						<label className = "form-label" for = "Name">Name</label></div>
					</div>
					<div></div>
				</form>
			</div>
		</Fragment>
	);
};

export default Contact;
